import React, { useEffect } from 'react';
import '../styles/components.css';

const Resume = () => {

  useEffect(() => {
    // Function to handle legend item and chart segment hover interactions
    const setupChartInteractions = () => {
      const legendItems = document.querySelectorAll('.chart-legend .legend-item');
      const chartSegments = document.querySelectorAll('.chart-segment');
      const skillCharts = document.querySelectorAll('.skill-chart');

      // Create percentage display elements for each chart
      skillCharts.forEach(chart => {
        const percentageDisplay = document.createElement('div');
        percentageDisplay.className = 'percentage-display';
        chart.appendChild(percentageDisplay);

        // Position in the center of the chart
        const updatePosition = () => {
          const rect = chart.getBoundingClientRect();
          percentageDisplay.style.left = '50%';
          percentageDisplay.style.top = '50%';
        };

        updatePosition();
        window.addEventListener('resize', updatePosition);

        return () => window.removeEventListener('resize', updatePosition);
      });

      const handleLegendHover = (e) => {
        const label = e.currentTarget.textContent.trim();
        const segment = document.querySelector(`.chart-segment[data-label="${label}"]`);

        if (segment) {
          // Highlight the segment and legend item
          chartSegments.forEach(s => s.classList.remove('segment-highlighted'));
          legendItems.forEach(item => item.classList.remove('active'));

          segment.classList.add('segment-highlighted');
          e.currentTarget.classList.add('active');

          // Show percentage in the center of the chart
          const chart = segment.closest('.skill-chart');
          const percentageDisplay = chart.querySelector('.percentage-display');
          const percentage = segment.getAttribute('data-percentage');
          if (percentage && percentageDisplay) {
            percentageDisplay.textContent = `${percentage}%`;
            percentageDisplay.style.opacity = '1';
          }
        }
      };

      const handleSegmentHover = (e) => {
        const label = e.currentTarget.getAttribute('data-label');
        const legendItem = Array.from(legendItems).find(item => 
          item.textContent.trim() === label
        );

        if (legendItem) {
          // Highlight the segment and legend item
          chartSegments.forEach(s => s.classList.remove('segment-highlighted'));
          legendItems.forEach(item => item.classList.remove('active'));

          e.currentTarget.classList.add('segment-highlighted');
          legendItem.classList.add('active');

          // Show percentage in the center of the chart
          const chart = e.currentTarget.closest('.skill-chart');
          const percentageDisplay = chart.querySelector('.percentage-display');
          const percentage = e.currentTarget.getAttribute('data-percentage');
          if (percentage && percentageDisplay) {
            percentageDisplay.textContent = `${percentage}%`;
            percentageDisplay.style.opacity = '1';
          }
        }
      };

      const resetHighlights = (e) => {
        // Only reset if not hovering over another segment or legend item
        if (!e.relatedTarget || 
            (!e.relatedTarget.closest('.chart-legend') && 
             !e.relatedTarget.closest('.chart-segment'))) {
          chartSegments.forEach(s => s.classList.remove('segment-highlighted'));
          legendItems.forEach(item => item.classList.remove('active'));

          // Hide all percentage displays
          document.querySelectorAll('.percentage-display').forEach(display => {
            display.style.opacity = '0';
          });
        }
      };

      // Add event listeners
      legendItems.forEach(item => {
        item.addEventListener('mouseenter', handleLegendHover);
        // Add mouse enter event listener to legend item
        item.addEventListener('mouseenter', () => {
          resetHighlights();
          highlightSegment(segmentClass);
        });

        // Add mouse leave event listener to legend item
        item.addEventListener('mouseleave', resetHighlights);
      });

      // Set up chart segment hover events
      chartSegments.forEach(segment => {
        // Extract the class that identifies the segment
        const segmentClass = Array.from(segment.classList)
          .find(cls => cls.startsWith('segment-') && cls !== 'chart-segment')
          ?.replace('segment-', '');

        if (!segmentClass) return;

        // Add mouse enter event listener to chart segment
        segment.addEventListener('mouseenter', () => {
          resetHighlights();
          highlightSegment(segmentClass);
        });

        // Add mouse leave event listener to chart segment
        segment.addEventListener('mouseleave', resetHighlights);
      });
    };

    // Call the setup function after a short delay to ensure DOM is fully loaded
    const timer = setTimeout(() => {
      setupChartInteractions();
    }, 500);

    // Cleanup function
